import "./App.css";
import Navbar from "./components/navbar/Navbar";
import compu from "./assets/img/compu.png";

function App() {
  return (
    <div className="App">
      <header>
        <Navbar />
      </header>
      <main>
        <div>
          <h1>El impulso<br/>
           que hace crecer<br/>
            tu marca</h1>
        </div>
        <div>
          <img src={compu} alt="Una mano sosteniendo un megáfono sale desde la pantalla de una computadora portátil, con un fondo de líneas onduladas en tonos azul y turquesa" />
        </div>
      </main>
    </div>
  );
}

export default App;
